import React from "react";
import Navbar from "../components/Navbar";

function Home() {
  return (
    <>
      <Navbar></Navbar>
      <div className="relative h-full w-full">
        <div className=" absolute margin-auto z-40">
          <h1>Book Slots For Your Vehicle</h1>
        </div>
        <div style={{backgroundImage : ""}}>
          <img
            className="h-dvh w-dvw"
            src="https://media.istockphoto.com/id/1356830579/photo/newly-striped-parking-lot.jpg?s=612x612&w=0&k=20&c=oJtKltmJGjsZ5SVllCVwm3cJzHQafcZmgbmbpWkH3tw="
          />
        </div>
      </div>
    </>
  );
}

export default Home;
